import React from "react";
import ReactDOM from "react-dom";

function ping() {
    fetch('../api')
      .then(response => response.text())
      .then(data => {return data});
}

const element = ping()

ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        <div>{element}</div>
    </div>,
    document.getElementById('root')
);
